import './App.css';
import {BrowserRouter,Routes,Route } from "react-router-dom";
import Signup from './components/signup';
import Navbar from './components/navbar';
const Routing = ()=>{
  return (
      <Route exact path="/" >
        <Signup />
      </Route>
  )
}

function App() {
  return (
    <Navbar />
  );
}

export default App;
